(4, 'c4f4ce08a75314a946154ad70b1b2b10', 77, ' خدمات موقع بوابة المستقبل', 'Other', 'who-are-we', 'https://futuregate.store/assets/uploads/blogs/category_icon/instagram.png', '<p style=\"text-align: center;\"><strong><span style=\"font-size: 14pt;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">شركة تسويق إلكتروني و إشهار وترويج أردنية و كويتية ، مقرها عمان ، تخدم العشرات من الانشطة التجارية على الانترنت منذ 2015 ، شركة خبراتنا في المجال إلى اكثر من ذلك ، حيث تمكننا من ترسيخ مفهوم التسويق الإلكتروني اون لاين في أذهان أصحاب المواقع ويعود ذلك بعد فضل الله إلى اجتهاد مجموعة العمل وخبراتهم الواسعة في المجال&nbsp;</span></span></span></strong></p>\r\n<p style=\"text-align: center;\"><strong><span style=\"font-size: 14pt;\"></span></strong></p>\r\n<p style=\"text-align: center;\"><strong><span style=\"font-size: 14pt;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">نحن شركة تسويق إلكتروني تأسست على مبدئين: الجودة والتخصص</span></span></span></strong></p>\r\n<p style=\"text-align: center;\"><strong><span style=\"font-size: 14pt;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">هدفنا هو تقديم ذات جودة عالية ، وأنا أجداد من خلال استثمارهم معنا ، نقدم لكم عزيزنا العميل أفضل جودة ونضع كافة خبراتنا بين يديك</span></span></span></strong></p>\r\n<p style=\"text-align: center;\"><strong><span style=\"font-size: 14pt;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">تعتبر خدمات التواصل الاجتماعي التي تقدمها شركة بوابة المستقبل ، وبعضها يتقدم في الوطن العربي والمتقدمين من خلاله.</span></span><br /></span></strong></p>', 'متابعين ، لايكات ،اعجابات ، مشاهدات ، تعليقات ، مشاهدات بث مباشر ، مشاهدات القصص ، مشاهدات ، ستوري ، منشن ، دايركت مسج ، انستقرام ، فيس بوك ، تويتر ، سناب شات ، يوتيوب ', 'Future Gate website for all social media services', 1, 1, '2022-03-28 21:32:58', '2022-05-18 15:00:36', 'Future gate services ', '<p style=\"text-align: center;\"><span style=\"font-size: 14pt;\"><strong></strong></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 14pt;\"><strong>A Jordanian and Kuwaiti e-marketing, advertising and promotion company, headquartered in Amman, serving dozens of commercial activities on the Internet since 2015. Our expertise in the field is more than that, as we were able to establish the concept of e-marketing online in the minds of website owners, and this is due after the grace of God To the diligence of the work group and their extensive experience in the field We are an e-marketing company founded on two principles: quality and specialization. , and some of them are progressing in the Arab world and applicants through it.</strong></span></p>');
INSERT INTO `general_faqs` (`id`, `lang`, `ids`, `uid`, `question`, `answer`, `sort`, `status`, `created`, `changed`) VALUES
(41, 'ar', 'b0a775b699e0b43c8802ad2f6e1555e4', 77, 'ما الفائدة من زيادة لايكات الصور أو الفيديوهات ؟', '<p xss=\"removed\">أن الأرقام أيضا لا يمكن تجاهلها. فعلى سبيل المثال بامكان حسابين وضع نفس الفيديو ولكن كمية التفاعل سوف تختلف لعوامل كثيرة أهمها عدد اللايكات فكلما قل عدد الايكات كلما تضاءلت فرص النجاح على المدى البعيد لذا زيادة عدد لايكات صورك وفيديوهاتك أمر ضروري لا يمكن تجاهله عندما تنتهي من شراء الايكات فانك سوف تلاحظ حصولك على متابعين أكثر بسبب زيادة الثقة وزيادة فرص ظهورك في الصفحة الرئيسية وفي الصور الأكثر تفاعلا عند البحث عبر الهاشتاقات</p>', 4, 1, '2019-10-09 21:51:00', '2022-03-28 21:21:47'),
(30, 'ar', '40e0e7949a20e7f58ace52310faa46b9', 77, 'لماذا أحتاج لموقع بوابة المستقبل ؟', '<p xss=\"removed\"><span xss=removed><strong>يمكن لموقع بوابة المستقبل أن يجعل عملكم أسهل وأسرع للوصول إلى هدفكم النهائي إذا كان لديكم عددأ كبيراً من المتابعين فسيشعر المستخدمون بمزيد من الثقة بكم على سبيل المثال عندما ندخل إلى الملف الشخصي لشخص ما على انستقرام فإننا ننظر أولاً إلى عدد متابعيه إذا كان لديه عدداً كبيراً من المتابعين فإننا نتعرف عليه كشخص مشهور لذلك يمكن أن يساعدكم موقع بوابة المستقبل على أن تبدوا أكثر شهرة للمستخدمين من ناحية أخرى إذا كان لديكم صفحة عن متجر تجاري فأنتم بحاجة إلى موقع يوابة المستقبل من أجل زيادة المبيعات وزيادة متابعيكم بسهولة</strong></span></p>', 1, 1, '2019-02-27 21:38:11', '2022-03-28 20:23:13'),
(40, 'ar', '167dc0c37ff4d514a84b19f662923f46', 77, ' ما المدة المستغرقة لتفعيل خدمة زيادة متابعين ؟', '<p><span xss=\"removed\"><strong>يتم تفعيل الخدمة وايصال جميع المتابعين اليك في نفس اليوم غالبا أو خلال 3 أيام كحد أقصى وهو عند حدوث تعديل في السيستم وتحديث في السيرفرات</strong></span></p>', 3, 1, '2019-10-09 21:50:42', '2022-03-28 21:22:06'),
(36, 'ar', 'f4221772b48b2c5f8a4d969bb1fd4e04', 77, ' هل يمكن زيادة المتابعين بدون باسورد ؟', '<p xss=removed><span xss=removed><strong>جميع الخدمات التي بتم تنفيذها من خلال موقع بوابة المستقبل لاتحتاج إلى كلمة المرور الخاصة بكم . على سبيل المثال إذا كنتم ترغبون في زيادة متابعيكم على انستقرام، فنحن نريد فقط عنوان صفحتكم لكي نبدأ على الفور في زيادة متابعيكم على انستقرام ولا حاجة أبداً إلى كلمة مروركم والمعلومات الخاصة الأخرى.</strong></span></p>', 2, 1, '2019-04-03 11:34:06', '2022-03-28 20:30:42'),
(42, 'en', 'b9462e5fd8c9030a0c7bf3cad61063db', 77, 'Why I need Future Gate?', '<p>Future Gate can make your work easier and faster to reach your end goal if you have a large number of followers users will feel more confident in you for example when we enter into someone’s profile on Instagram we first look at the number of his followers if he has a large number of followers Followers, we know him as a famous person, so the future portal site can help you to appear more popular to users. On the other hand, if you have a page about a commercial store, you need the future portal site in order to increase sales and increase your followers easily</p>', 1, 1, '2022-05-03 17:04:22', '2022-05-06 14:17:06'),
(43, 'en', '61aff18e2641c5f9013fe8b9b9dc1618', 77, 'Is it possible to increase followers without a password ?', '<p>test answerAll services implemented through the Future Gate website do not require your password. For example, if you want to increase your Instagram followers, we just want your page address so that we can immediately start increasing your Instagram followers and never need your password and other private information.</p>', 2, 1, '2022-05-03 17:26:38', '2022-05-06 14:18:28'),
(44, 'en', 'cfaf526c204495421fb44b266d55fc6a', 77, 'How long does it take to activate the service to increase followers?', '<p>The service is activated and all followers are delivered to you on the same day, often or within 3 days as a maximum, which is when there is an adjustment in the system and an update in the servers</p>', 3, 1, '2022-05-06 14:20:42', '2022-05-06 14:21:54'),
(45, 'en', '4f7cceda2bddb8f9d64467b19d58ec0c', 77, 'What is the benefit of increasing the likes of images or videos?', '<p>The numbers also cannot be ignored. For example, two accounts can put the same video, but the amount of interaction will differ for many factors, the most important of which is the number of likes. The fewer likes, the fewer the chances of success in the long run. Therefore, increasing the number of likes for your photos and videos is a necessity that cannot be ignored. When you finish buying likes, you will notice that you will get More followers due to increased trust and increased chances of appearing on the home page and in the most interactive photos when searching through hashtags</p>\r\n<p></p>', 4, 1, '2022-05-06 14:23:18', '2022-05-06 14:23:18');
