(27, 'currency_symbol', '$'),
(28, 'terms_content', '&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 14pt;&quot;&gt;&lt;strong&gt; إن حقوق النشر وكافة حقوق الملكية الفكرية الأخرى في كافة المواد والمحتوى الذي يتم توفيره كجزء من موقع بوابة المستقبل&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;br /&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;هي ملك لنا في كافة الأوقات. يجوز لك استخدام هذه المادة أو المحتوى فقط على النحو المصرح به خطّيا من قبلنا ولن تقوم بمساعدة أو تسهيل عمل الغير على، نسخ المادة أو المحتوى، أو إعادة إنتاجه، أو بثه، أو توزيعه، أو تكييفه أو استخدامه على نحو تجاري أو إيجاد أعمال مبنية عليها. إذا علمت بوجود توزيع أو استغلال تجاري من أي نوع، فأنت توافق على إعلامنا بذلك مباشرة يمكنك التواصل معنا دائما للمساعده او لطلب نسخه عن قوانين الموقع على&amp;nbsp;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;البريد الالكـتـروني :- &lt;a href=&quot;mailto:futuregate@futuregate.store&quot;&gt;futuregate@futuregate.store&lt;/a&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;div style=&quot;text-align: right;&quot;&gt;&lt;/div&gt;'),
(29, 'policy_content', '&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 14pt;&quot;&gt;&lt;strong&gt;الخصوصية&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;يعتبر موقع بوابة المستقبل سرية وحماية معلومات عملائه الكرام من أهم أولوياتها. لذا فإننا نتعهد بان نلتزم بأعلى معايير الحماية للحفاظ على سرية وسلامة معلوماتكم وسجلاتكم واستخدامها في المجالات المخصصة لها فقط&lt;/strong&gt;&lt;br /&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 14pt;&quot;&gt;&lt;strong&gt;أمن المعلومات الشخصية في التواصل الاجتماعي&amp;nbsp;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;يقوم موقع بوابة المستقبل باتخاذ الإجراءات و التدابير المناسبة و الملائمة للحفاظ على معلوماتك الشخصية التي في حوزتنا بشكل آمن يضمن حمايتها من الفقدان أو الدخول غير المصرح به أو إساءة الاستخدام، أو التعديل و الإفصاح غير المصرح بهما&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;من أهم التدابير المعمول بها في ادارة الموقع لحماية معلوماتك يتعهد موقع بوابة المستقبل بالحفاظ على أية معلومات تخص عملائه وفقا لأدق معايير السلامة والسرية القياسية&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;معلومات العملاء تستخدم على أدنى حد نحتاجه لتقديم خدمات رفيعة المستوى ترضى تطلعاتكم ومعلومات العملاء سوف تستخدم من قبل الأشخاص المصرح لهم فقط، والمدربين تدريبا عاليا على إدارة طلبات العملاء، علما بأن أي موظف ينتهك هذا الالتزام سيكون عرضة للمساءلة القانونية المعمول بها في خدمات مواقع التواصل الاجتماعي&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;نلتزم بعدم إرسال أي رسائل إلكترونية لكم إلا من خلال النطاق الخاص بنا لضمان عدم تعرضكم لأي رسائل إلكترونية مزورة يحرص موقع بوابة المستقبل على إبلاغ العملاء عن ما نقدمه من خدمات، أو الحصول على موجز بآخر أخبار الموقع والخدمات الأخرى وذلك دون أن نطلب منك إعطاءنا أية معلومات عنك&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;يضمن موقع بوابة المستقبل أن المعلومات الشخصية او أية معلومات أساسية أو تعريفية تخصك كعميل لنا تستخدم فقط لتقديم خدمات ذات جودة عالية المستوى وسوف نحافظ على هذه المعلومات طبقاً لمعاييرنا الخاصة لأمن وسرية المعلومات هذا وسوف نعمل دوما على تقييم أنفسنا وفق معايير التقييم المعتمدة من أجل التأكد من التقيد التام بمعاييرنا الخاصة بسرية وسلامة معلوماتكم وسوف نمارس نشاطنا بطريقة تكفل الوفاء بوعدنا لكم في كافة الخدمات التي نعمل فيها&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14pt;&quot;&gt;التوعية الأمنية&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;يعتبر موقع بوابة المستقبل سرية معلومات عملائه الكرام من أهم أولوياتها. لذا فإننا نتعهد بان نلتزم بكل ما من شأنه الحفاظ على سرية معلوماتكم وأن تظل ثقتكم بنا هي الركيزة الأساسية التي نعمل من اجل تعزيزها والحفاظ عليها&lt;/strong&gt;&lt;br /&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14pt;&quot;&gt;&lt;br /&gt;الإجـراءات التـي يـتخذها مـوقع بـوابة المستقبل للتأكد من أمان وحماية عملياتك على الإنترنت&lt;/span&gt;&lt;/strong&gt;&lt;span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: right;&quot;&gt;&lt;/p&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;الجلسات الآمنة :- عند دخولك إلى موقعنا او لوحة تحكم البائعين تكون قد دخلت إلى جلسة آمنة وبوسعك التأكد من أنك في جلسة آمنة بالنظر إلى عنوان الموارد الموحد&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;(URL)&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;في الجلسات الآمنة يبدأ عنوان الموارد الموحد للصفحة&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;https://&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;و يظهر في زاوية المتصفح السفلية اليمنى رمز يمثل القفل&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;التشفير:- استخدام تقنية في تشفير معلوماتك الخاصة&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;(SSL)&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;قبل إرسالها من حاسبك على الإنترنت بحيث لا يستطيع أحد الإطلاع عليها. في الغالب سيقوم المتصفح (حسب إعدادات المتصفح) بإخطارك بأنك على وشك الدخول إلى موقع آمن&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;/div&gt;\r\n&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;انقطاع الجلسة:- في حال إغلاق المتصفح بدون الخروج من الموقع ، أو في حال ترك الحاسب لمدة معينة من الوقت سيتم إخراجك من الموقع لحمايتك. للعودة إلى الموقع ، عليك أن تعود إلى الصفحة الرئيسية و تعاود الدخول من جديد&lt;/strong&gt;&lt;/span&gt;&lt;/div&gt;'),
