(61, 'new_order_notification_send_to_customer_content_en', '<p><strong><span xss=\"removed\">Hello there,</span></strong><span xss=\"removed\"></span></p>\r\n<p><strong><span xss=\"removed\">Future Gate store welcomes you</span></strong></p>\r\n<p><strong><span xss=\"removed\">You have successfully fulfilled the request</span></strong></p>\r\n<p><span xss=\"removed\"><strong><span xss=\"removed\">Below is your order information</span></strong></span></p>\r\n<ul>\r\n<li><strong><span xss=\"removed\">Email: {{customer_email}}</span></strong></li>\r\n<li><strong><span xss=\"removed\">Order ID: {{order_id}}</span></strong></li>\r\n<li><strong><span xss=\"removed\">Package: {{package_name}}</span></strong></li>\r\n<li><strong><span xss=\"removed\">Amount: {{amount}}</span></strong></li>\r\n</ul>\r\n<ul></ul>\r\n<p><strong><span xss=\"removed\">Request Inquiry Link</span></strong></p>\r\n<p><span xss=\"removed\"><strong>{{manage_orders_link}}</strong></span></p>\r\n<p><strong><span xss=\"removed\">We hope you enjoyed using the store</span></strong></p>\r\n<p><strong><span xss=\"removed\">Thanks and best regards</span></strong></p>\r\n<ul></ul>'),
(58, 'terms_content_en', '&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 14pt;&quot;&gt;&lt;strong&gt;The copyright and all other intellectual property rights in all materials and content that are provided as part of the Future Gate website&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;It is ours at all times. You may use this material or content only as authorized in writing by us and will not assist or facilitate third parties to copy, reproduce, broadcast, distribute, adapt or commercially use the material or content or create works based on her. If you become aware of the existence of distribution or commercial exploitation of any kind, you agree to notify us directly. You can always contact us for assistance or to request a copy of the site rules at&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;Email :- &lt;a href=&quot;mailto:futuregate@futuregate.store&quot;&gt;futuregate@futuregate.store&lt;/a&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;/p&gt;'),
(59, 'policy_content_en', '&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 14pt;&quot;&gt;&lt;strong&gt;Privacy&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;The Future Gate website considers the confidentiality and protection of the information of its valued customers as one of its most important priorities. Therefore, we pledge to adhere to the highest standards of protection to maintain the confidentiality and integrity of your information and records and to use them only in the areas designated for them&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 14pt;&quot;&gt;&lt;strong&gt;Security of personal information in social media&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;The Future Gate website takes the appropriate and appropriate measures and measures to keep your personal information in our possession in a secure manner that ensures its protection from loss, unauthorized access, misuse, or unauthorized modification and disclosure.&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;One of the most important measures in place in managing the site to protect your information The Future Gate site undertakes to maintain any information related to its customers in accordance with the strictest standards of safety and standard confidentiality&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;Customer information is used to the minimum we need to provide high-level services that satisfy your aspirations and customer information will be used by authorized persons only, who are highly trained in managing customer requests, knowing that any employee who violates this obligation will be subject to legal accountability applicable to social networking services.&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;We are committed not to send any e-mails to you except through our domain to ensure that you are not exposed to any fraudulent e-mails. The Future Gate website is keen to inform customers about our services, or to obtain a summary of the site&#039;s latest news and other services without asking you to give us any information About You The Future Gate website ensures that personal information or any basic or identifying information about you as a customer of ours is used only to provide high-quality services and we will maintain this information according to our own standards for the security and confidentiality of this information and we will always work to evaluate ourselves according to the approved evaluation criteria in order to ensure that Full compliance with our standards of confidentiality and integrity of your information and we will conduct our activities in a manner that ensures that our promise to you is fulfilled in all the services in which we work&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 14pt;&quot;&gt;&lt;strong&gt;Security Awareness&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;The Future Gate website considers the confidentiality of the information of its valued customers as one of its most important priorities. Therefore, we pledge to abide by everything that would maintain the confidentiality of your information, and that your trust in us remains the main pillar that we are working to strengthen and preserve.&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 14pt;&quot;&gt;&lt;strong&gt;The measures that the Future Gate website takes to ensure the security and protection of your operations on the Internet&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size: 12pt;&quot;&gt;&lt;strong&gt;Secure Sessions: When you log on to our site or the vendor control panel, you are logged into a secure session and you can be sure that you are in a secure session by looking at the Uniform Resource Address (URL) of the secure sessions. The URL of the page starts with https:// and appears in the bottom corner of the browser The right symbol represents the lock. Encryption: Using a technology to encrypt your private information (SSL) before sending it from your computer on the Internet so that no one can see it. Mostly, the browser (depending on your browser settings) will notify you that you are about to enter a secure site. Session interruption: - If the browser is closed without leaving the site, or if the computer is left for a certain period of time, you will be removed from the site for your protection. To return to the site, you have to go back to the main page and log back in&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;');
